import React from "react";
import Hdata from "./DOH"
function App(prop){
	return (
	
	<div className='container'>
	<div className='container_img'>
	<img src={prop.Hdata.IS} />
	</div>
	<div className='container_detail'>
	<h1 className="hotel_name">{prop.Hdata.HN}</h1>
	<h1 className="hotel_prize" >{prop.Hdata.HP}</h1>
	
	</div>
	
	</div>
	
	)
}
export default App;
